void mainImage(out vec4 fragColor, in vec2 fragCoord) {
    vec2 uv = fragCoord / iResolution.xy;

    vec4 vid1 = texture(iChannel0, uv);
    vec4 vid2 = texture(iChannel0, uv); 

    float k = 5.;
    int m = 2;

    float vnr = float((int(k * vid1.r) * int(k * vid2.r)) % m);
    float vng = float((int(k * vid1.g) * int(k * vid2.g)) % m);
    float vnb = float((int(k * vid1.b) * int(k * vid2.b)) % m);

    fragColor = vec4(tan(vnr), tan(vng), tan(vnb), 1.0);
}

